import React from "react";
import Accordion from "./Accordion";
import styles from "./Education.module.css";

function Education() {
  const accordionData = [
    {
      label: "Bachelor degree at the Massey University",
      content: "February 2021 - June 2023 | Software Engineering Major",
    },
    {
      label: "Diploma degree at the Waikato Institute of Technology",
      content: "February 2019 - November 2020 | Software Engineering Major",
    },
  ];

  return (
    <section id="edu" className={`${styles.eduSection} pt-5 route`}>
      <div className="container">
        <div className="row">
          <div className="col-sm-12">
            <div className={styles.titleBox}>
              <h3 className={styles.title}>Education</h3>
              <div className={styles.line} />
            </div>
          </div>
        </div>

        {/* accordion*/}
        <div className="row">
          <div className={styles.accordion}>
            {accordionData.map((item, index) => (
              <Accordion
                key={index}
                label={item.label}
                content={item.content}
              />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
}

export default Education;
